import css from "styled-jsx/css";

export default css`
  ul {
    display: flex;
    width: 60vh;
    justify-content: space-around;
    list-style: none;
    font-family: Verdana;
    border-bottom: 1px solid lightgrey;
  }

  a {
    text-decoration: none;
  }

  li {
    padding-bottom: 4px;
  }

  li:hover {
    padding: 0;
    border-bottom: 4px solid grey;
    padding: 0 4px 4px 4px;
  }
`;
